(364,'Walter Feaster','walter.feaster19@yahoo.com','795569600','Claim Your $32,222 SETC Tax Credit Before It’s Too Late!\r\n\r\nAre you self-employed, a gig worker, or run a sole proprietor business? Have you filed a 1099 form between 2019 and 2023? If you answered \"yes,\" you may qualify for up to $32,222 with the SETC (Self-Employed Tax Credit) without the need to repay it.\r\n\r\nThis is not a PPP (Paycheck Protection Program) loan, and it\'s completely repayable-free. Discover if you qualify before time runs out. The deadline to claim your tax credit is April 15, 2024.\r\n\r\nClick the link below to see if you qualify\r\n https://aluzzion.com/go/setc\r\n\r\nWhat is the SETC?\r\nThe Self-Employed Tax Credit (SETC) was established by Congress to offer financial relief to sole proprietors, 1099 contractors, freelancers, single-member LLCs, gig workers, and other self-employed individuals. This groundbreaking legislation was designed to mitigate the economic impact experienced by self-employed Americans due to government-ordered shutdowns, quarantine, illness, caregiving, or other events that reduced income. Don’t miss out on this opportunity – the deadline to claim your tax credit is April 15, 2024.','Other','E b tiu','Kpouxpzxh',1,'2024-04-18 08:18:54','2024-04-18 08:18:54'),
