insert  into `white_label_products`(`wl_product_id`,`product_name`,`product_description`,`content`,`dosage_form`,`strength`,`therapeutic_use`,`image`) values 
(4,'BROPAN 40','PANTOPRAZOLE 40 MG','Pantoprazole','CAPSULE','40 MG','Pantoprazole reduces the amount of acid your Stomach makes. It’s used for heartburn, acid  reflux & gastro-esophageal reflux disease (GORD) – GORD is when you keep getting acid reflux.  It\'s also taken to prevent and treat stomach ulcers.','BROPAN_40.pdf'),
(5,'CHIACOLD','CETIRIZINE + PARACETAMOL + PHENYLEPHRINE ','Paracetamol + Phenylephrine + Cetirizine Hydrochlo','SUSPENSION','125 MG + 5 MG + 2 MG','CETIRIZINE + PARACETAMOL + PHENYLEPHRINE is primarily used to treat the common cold and \r\nallergy Symptoms such as runny nose, blocked nose, sneezing, congestion, pain & fever.','CHIACOLD.pdf'),
(6,'BROXIME 100','CEFPODOXIME PROXETIL FOR ORAL SUSPENSION','Cefpodoxime','DRY SYRUP','100 MG','Cefpodoxime is used to treat certain infections caused by bacteria such as bronchitis (infection \r\nof the airway tubes leading to the lungs); pneumonia; gonorrhea (a sexually transmitted \r\ndisease); and infections of the skin, ear, sinuses, throat, tonsils, and urinary tract.','BROXIME_100.pdf'),
(7,'BROZOL','METRONIDAZOLE BENZONATE ORAL\r\n','Metronidazole','SUSPENSION','200 MG','Metronidazole treats infections caused by bacteria or Parasites. It belongs to a group','BROZOL.pdf'),
(8,'BROCIR 10','CETIRIZINE HYDROCHLORIDE TABLET','Cetirizine Hydrochloride','TABLET','10 MG','Cetirizine is used to relieve the symptoms of hay fever and hives of the skin. It is an  antihistamine that works by preventing the effects of a substance called histamine, which is  produced by the body. Histamine can cause itching, sneezing, runny nose, and watery eyes.','BROCIT_10.pdf'),
(9,'CALTONIA','CALCITRIOL + CALCIUM CARBONATE + ZINC ','Calcium Carbonate + Calcitriol + Zinc','TABLET','500 MG + 0.25 MG + 7.5 MG','CALCITRIOL + CALCIUM CARBONATE + ZINC effectively treats various conditions caused by low  calcium levels in the body, such as osteoporosis (weak and brittle bones), oseomalacia / rickets  (weak bones), hypoparathyroidism (low levels of parathyroid hormone), & latent tetany (a  muscle disease with low blood calcium levels).','CALTONIA.pdf'),
(10,'BROMOL IV','PARACETMOL INFUSION 1G','Paracetamol','INJECTABLE','1 GM','Paracetamol,\' which is an analgesic (relieves pain) and an antipyretic (reduces fever).','BROMOL_IV.pdf'),
(11,'BROXIME 50','CEFPODOXIME PROXETIL FOR ORAL SUSPENSION','Cefpodoxime','DRY SYRUP','50 MG','Cefpodoxime is used to treat certain infections caused by bacteria such as bronchitis (infection  of the airway tubes leading to the lungs); pneumonia; gonorrhea (a sexually transmitted  disease); and infections of the skin, ear, sinuses, throat, tonsils, and urinary tract.','BROXIME_50.pdf'),
(12,'BROMEZ','OMEPRAZOLE 40 GM','Omeprazole','INJECTION','40 GM','Omeprazole is used to treat certain stomach & esophagus problems (such as acid reflux, ulcers).  It works by decreasing the amount of acid your stomach makes. It relieves symptoms such as  heartburn, difficulty swallowing, and cough.','BROMEZ.pdf'),
(13,'BROFLO 200','OFLOXACIN TABLET','Ofloxacin','TABLET','200 MG','Ofloxacin belongs to a class of drugs called quinolone antibiotics. It works by stopping the  growth of bacteria. This antibiotic treats only bacterial infections','BROFLO_200.pdf'),
(14,'BROPAN 40','PANTOPRAZOLE 40 MG','Pantoprazole','CAPSULE','40 MG','Pantoprazole reduces the amount of acid your Stomach makes. It’s used for heartburn, acid \r\nreflux & gastro-esophageal reflux disease (GORD) – GORD is when you keep getting acid reflux. \r\nIt\'s also taken to prevent and treat stomach ulcers.','BROPAN_401.pdf');
